import React from 'react';

const Navbar = () => {
    return (
        <div className='flex flex-col md:flex-row justify-end items-center bg-green-600 w-full h-20'>
            <h1>ddddd</h1>
            <ul className='flex flex-row gap-5 px-14 items-center text-white text-sm md:text-sm font-bold'>

                <li className='bg-green-100 p-2 rounded-md items-center text-black px-10'>
                    Sign in
                </li>
                <li className='bg-green-100 p-2 rounded-md items-center text-black px-10'>
                    Login
                </li>


            </ul>
        </div>
    );
}

export default Navbar;
